import Logo from "../assets/images/logo.png";
import latestPost from "../assets/images/latestpost.jpg";
import theProfile from "../assets/images/theprofile.jpg";
import noImage from "../assets/images/noImage.jpg";
import user from "../assets/images/user.png";

const images = {
   Logo,
   latestPost,
   theProfile,
   noImage,
   user,
};

export default images;
